import React from 'react';

const Header = () => {
  const headerStyle = {
    backgroundColor: '#e8f5e9',
    padding: '10px 20px',
  };

  const logoStyle = {
    display: 'flex',
    alignItems: 'center',
  };

  const logoImageStyle = {
    height: '40px',
    marginRight: '10px',
  };

  const logoTextStyle = {
    fontSize: '24px',
    fontWeight: 'bold',
    color: '#388e3c',
    margin: 0,
  };

  const navLinkStyle = {
    color: '#388e3c',
    fontWeight: '500',
    textDecoration: 'none',
    marginLeft: '10px',
  };

  return (
    <header style={headerStyle}>
      <div className="container d-flex justify-content-between align-items-center">
        {/* Logo */}
        <div style={logoStyle}>
          <img src="/logo.png" alt="EcoGuard Logo" style={logoImageStyle} />
          <h1 style={logoTextStyle}>EcoGuard</h1>
        </div>

        {/* Navigation */}
        <nav>
          <ul className="nav" style={{ margin: 0, padding: 0 }}>
            <li className="nav-item">
              <a className="nav-link" href="/" style={navLinkStyle}>
                Home
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="/report" style={navLinkStyle}>
                Report
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="/statistics" style={navLinkStyle}>
                Statistics
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="/article" style={navLinkStyle}>
                Article
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="/contact" style={navLinkStyle}>
                Contact
              </a>
            </li>
          </ul>
        </nav>

        {/* Login Button */}
        <button
          className="btn"
          style={{
            backgroundColor: '#388e3c',
            color: '#fff',
            borderRadius: '5px',
            padding: '8px 15px',
          }}
        >
          Login
        </button>
      </div>
    </header>
  );
};

export default Header;
